-- Texas Stores Import (Generated from Google Sheets)
-- Data source: https://docs.google.com/spreadsheets/d/18E6OfiZ4ikihL8jL98SdKlbyruBHkZPbZJ9QJ7VPCfU/edit?usp=sharing

-- Create temporary table for import
CREATE TEMP TABLE temp_texas_stores (
    chain VARCHAR(100),
    division VARCHAR(100),
    banner VARCHAR(100),
    store_name VARCHAR(200),
    store_number VARCHAR(50),
    address VARCHAR(500),
    city VARCHAR(100),
    state VARCHAR(10),
    zip VARCHAR(20),
    metro VARCHAR(200),
    country VARCHAR(10),
    phone VARCHAR(20),
    state_norm VARCHAR(10)
);

-- Insert all Texas stores

-- Insert into stores table
    name,
    address,
    city,
    state,
    zip_code,
    phone,
    is_active,
    created_at,
    updated_at
)
SELECT 
    CASE 
        WHEN store_name IS NOT NULL AND store_name != '' THEN store_name
        WHEN banner IS NOT NULL AND banner != '' THEN banner
        ELSE 'Unknown Store'
    END as name,
    address,
    city,
    state,
    zip,
    phone,
    true as is_active,
    NOW() as created_at,
    NOW() as updated_at
FROM temp_texas_stores
WHERE state = 'TX'
ON CONFLICT (name, address) DO UPDATE SET
    phone = EXCLUDED.phone,
    updated_at = NOW();

-- Clean up
DROP TABLE temp_texas_stores;